import React from "react";
import { useEffect } from "react";
import { jMoment } from "jalali-moment";

export const ConvertData = ({ data }) => {
  useEffect(() => {
    const rawData = data.created_at;
    jMoment(rawData).format("jYYYY/jMM/jDD");
  }, [data]);
  return <div></div>;
};
